import { NavLink } from "react-router-dom";
import "./navbar.css"

function Navbar() {
  return (
    <header class="navbar">
        <NavLink className="navbar-brand" to="/">
          Junebug
        </NavLink>
        <ul class="navbar-nav">
          <li className="nav-item">
            <NavLink className="nav-link" to="/">
              Sign In
            </NavLink>
          </li>
        </ul>
    </header>
  );
}

export default Navbar;
